import React from 'react';
import './Reclamacoes.css';
import { FiLogOut, FiFileText } from 'react-icons/fi'; // Importando ícones

// Dados de exemplo para as reclamações
const mockReclamacoes = [
    { id: 1, texto: 'Rua Pedro Álvares Cabral com Arvores quebrada', status: 'pendente' },
    { id: 2, texto: 'Rua Estevão Pinheiro com buraco enorme', status: 'atendido' },
    { id: 3, texto: 'Em frente a escola fulano de tal caiu uma arvore', status: 'pendente' },
    { id: 4, texto: 'Rua Pedro Álvares Cabral com Arvores quebrada', status: 'atendido' },
    { id: 5, texto: 'Rua Pedro Álvares Cabral com Arvores quebrada', status: 'pendente' },
];

// Componente para um item individual da lista
const ReclamacaoItem = ({ reclamacao }) => {
    // Define a classe CSS com base no status da reclamação
    const statusClassName = `status-${reclamacao.status}`;

    return (
        <div className="reclamacao-item">
            <span className="reclamacao-texto">{reclamacao.texto}</span>
            <div className="reclamacao-acoes">
                <FiFileText className="reclamacao-icon" size={24} />
                <span className={`reclamacao-status ${statusClassName}`}>
                    {reclamacao.status === 'pendente' ? 'pendente' : 'pendente'}
                </span>
            </div>
        </div>
    );
};


// Componente principal da tela
const Reclamacoes = () => {
    return (
        <div className="tela-reclamacoes">
            <header className="header">
                <img src="https://i.imgur.com/eBiph2j.png" alt="Logo Prefeitura Ponta Porã" className="logo" />
                <button className="btn-sair">
                    <FiLogOut size={20} style={{ marginRight: '8px' }} />
                    Sair
                </button>
            </header>

            <nav className="navbar">
                <a href="#">Home</a>
                <a href="#">Mapa</a>
                <a href="#" className="active">Reclamações</a>
                <a href="#">Relatórios</a>
            </nav>

            <main className="main-content">
                <div className="filtro-container">
                    <input
                        type="text"
                        placeholder="Digite aqui... Ex: Rua pedro alves 857"
                        className="input-busca"
                    />
                    <div className="filtro-wrapper">
                        <span>Filtrar por</span>
                        <select className="select-filtro">
                            <option value=""></option>
                            <option value="recentes">Mais Recentes</option>
                            <option value="antigas">Mais Antigas</option>
                        </select>
                    </div>
                </div>

                <div className="lista-reclamacoes">
                    {mockReclamacoes.map(item => (
                        <ReclamacaoItem key={item.id} reclamacao={item} />
                    ))}
                </div>
                 <div className="scrollbar-falsa">
                    <div className="scrollbar-thumb"></div>
                </div>
            </main>

            <footer className="footer">
                <img src="https://i.imgur.com/eBiph2j.png" alt="Logo Prefeitura Ponta Porã" className="logo-footer" />
            </footer>
        </div>
    );
};

export default Reclamacoes;
